INSERT INTO `blogs` (`id`, `title`, `body`, `filename`, `mimetype`, `filedata`, `created_at`, `updated_at`) VALUES
(3, 'Perfecto para relajarse', 'Les Cols Pavellons está situado en Olot, cerca de la reserva natural volcánica de la Garrotxa, y ofrece un tipo inusual de alojamiento en habitaciones de decoración zen con suelo y paredes de cristal. Les Cols Pavellons está rodeado de campo y cuenta con 5 pabellones, cada uno de los cuales incluye un onsen climatizado, un baño privado y un cómodo futón. Junto al establecimiento encontrará una típica masía catalana, que alberga un restaurante galardonado con 2 estrellas Michelines.', 'post2.jpg', 'image/jpeg', , '2019-11-26', '2019-11-26');
INSERT INTO `blogs` (`id`, `title`, `body`, `filename`, `mimetype`, `filedata`, `created_at`, `updated_at`) VALUES
(4, 'Hotel excelente', 'Descubre por qué tantos viajeros ven Les Cols Pavellons como el hotel ideal cuando visitan Olot. Además de aportar la combinación ideal de calidad, comodidad y ubicación, ofrece un ambiente romántico con una amplia variedad de servicios diseñados para viajeros como tú. Las habitaciones de los huéspedes incluyen aire acondicionado, y Hotel Les Cols te ayuda a que estés conectado, ya que dispone de wifi gratuito. También puedes aprovechar algunos de los servicios que ofrece el hotel, como servicio de habitaciones, espacio para guardar el equipaje y zona de picnic. Además, los huéspedes pueden disfrutar de desayuno incluido durante su visita. Otra ventaja añadida es que hay parking gratis disponible para los huéspedes. Mientras estés en Olot no dejes de probar demandados platos de tapas en Umami, El Celler o El Cafe Del Firal. No faltan cosas que hacer por la zona: explora populares museos de historia natural como Olot. Estamos seguros de que disfrutarás de tu estancia en Les Cols.', 'post1.jpg', 'image/jpeg', , '2019-11-26', '2019-11-26');
INSERT INTO `blogs` (`id`, `title`, `body`, `filename`, `mimetype`, `filedata`, `created_at`, `updated_at`) VALUES
(5, 'Perfecto para relajarse', 'Les Cols Pavellons está situado en Olot, cerca de la reserva natural volcánica de la Garrotxa, y ofrece un tipo inusual de alojamiento en habitaciones de decoración zen con suelo y paredes de cristal. Les Cols Pavellons está rodeado de campo y cuenta con 5 pabellones, cada uno de los cuales incluye un onsen climatizado, un baño privado y un cómodo futón. Junto al establecimiento encontrará una típica masía catalana, que alberga un restaurante galardonado con 2 estrellas Michelin.', 'post3.jpg', 'image/jpeg', , '2019-11-26', '2019-11-26');

